import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  var [username, usernamedata] = useState(['호랑이', '사자']);


  return (
    <div>
      <div className="nav-bar"> 
        <h3>{username[0]}님 저장소</h3>
        <ul>
          <li>Todo List</li>
          <li>Done List</li>
        </ul>
      </div>

      {
        <TodoInput />
      }


    </div>
  );
}


function TodoInput() {
  return (
    <div>
      <div class="input-box">
        <input id="input" type="text" placeholder="할 일을 입력하세요." /><button id="add">+</button>
      </div>
      <div class="list">
        <ul id="to-do-list"></ul>
      </div>
    </div>
  )
}

export default App;
